$(document).on("click",".update-gallery",function(){let i="/admin/dashboard/galleries/edit/"+$(this).data("uuid");axios.get(i).then(function(l){let{data:e}=l.data,a=$("#galleryUpdateModal");a.find("#title").val(e.title),a.find("#description").val(e.description),a.find("#gallery_type").val(e.type).trigger("change"),a.find('input[name="is_active"]').prop("checked",e.is_active),a.find(".image-input-wrapper").css("background-image","url(/storage/"+e.path+")");let t=a.find("#gallery_uuid");t.length?t.val(e.gallery_uuid):$("<input>").attr({type:"hidden",id:"gallery_uuid",name:"gallery_uuid",value:e.gallery_uuid}).appendTo("#galleryUpdateForm"),a.modal("show")}).catch(function(l){error(l)})});
